          "id": "9cb3329fbb643e16b2502ac3c604b5f0d6ede514",
          "message": "Integrate assembler into il compiler (#192)\n\n* ILCompiler now runs assembler to convert assembly code to binary\r\n\r\n* Remove separate call to zmac assembler from projects that call ILCompiler as this will now call the assembler\r\n\r\n* Project to create DSK image from all samples now needs to get the tools as the individual sample projects no longer do this\r\n\r\n* Integration tests don't need to get tools any more in the build event batch script\r\n\r\n* Common code used in tests no longer needs to call assembler explicitly as is done as part of ILCompile now.\r\n\r\n* Script to get tools doesn't need to retrieve zmac assembler as ILCompiler will do this when needed itself\r\n\r\n* Remove NoAssemble option as not used.\r\n\r\n* Add tests to check ILCompiler can download assembler and pick output type based on target architecture\r\nFix code smells\r\n\r\n* Add option to delete assembler before compiling il.\r\nAdd option to not use cim as output type\r\n\r\n* Fix code smells\r\n\r\n---------\r\n\r\nCo-authored-by: Colin Taylor <drcjt@outlook.com>",
