          "message": "Use EETypePtr with NewString (#255)\n\n* Fix bug in code gen for internal calls - it's the last parameter not the first that can be passed in registers\r\n\r\n* Extend native int to support values determined by assembly symbols\r\n\r\n* Pass EEType ptr to NewString assembly code\r\nAdd EETypePtr.EETypePtrOf<T> to get EETypePtr's and use in code creating strings\r\nImplement EETypePtrOf as an intrinsic to do simple lookup for EEType symbol\r\n\r\n* Update dependency analyser to add constructed dependency on type when used in EETypePtrOf<T>\r\n\r\n* Remove unnecessary code\r\n\r\n* Remote EETypePtr.ToPointer() as not used currently\r\n\r\n---------\r\n\r\nCo-authored-by: Colin Taylor <drcjt@users.noreply.github.com>",
