          "distinct": true,
          "id": "74ddd1f5119318c44aa98911673a8400e54b26de",
          "message": "Add EEType class (#258)\n\n* Fix bug in codegen for internal calls - wasn't passing last parameter via registers correctly\r\nAdd EEType struct\r\nChange EETypePtr to use EEType internally instead of IntPtr\r\nMake Object.m_pEEType internal\r\n\r\n* Refactor string test to new up string properly rather than use internal NewString method\r\n\r\n* Remove todos in UnsafeTests and enable code that now works due to previous fixes/enhancements in the compiler\r\n\r\n* Add tests for managed object allocation\r\nSimple validation of EETypes\r\nSimple validation that correct memory size is allocated\r\n\r\n* Use EEType class in NewString signature\r\n\r\n* Check if AllocSizeTests are failing on github build server\r\n\r\n* Fix bug in GetTotalMemory due to not clearng carry flag\r\nRe-enable corelib Alloc size tests\r\n\r\n* Refactor Alloc tests to avoid bug with importer not spilling correctly\r\n\r\n---------\r\n\r\nCo-authored-by: Colin Taylor <drcjt@users.noreply.github.com>",
