          "message": "Rework static constructor invocation (#299)\n\n* Add test to validate that static constructors are called correctly\r\n\r\n* Expose method to check if MethodDesc is an instance constructor\r\n\r\n* Extend dependency analysis to add static constructor as dependency when new'ing up an object if the type has a static constructor\r\n\r\n* Invoke static constructor when accessing field if required\r\n\r\n* Codegen for cctor will self modify to change first instruction to a ret to avoid it running more than once\r\n\r\n* When importing a ctor add call to invoke static constructor if one exists\r\n\r\n* Add new methodical tests to solution\r\n\r\n* Remove \"eager\" calls to static constructors\r\n\r\n* Add comma stack node\r\nUse in cctor trigger from field access\r\n\r\n* Trigger static constructor from static field store\r\nTrigger static constructor from address of static field\r\n\r\n* Refactor code for creating call to static constructor into helper class\r\n\r\n* Trigger static constructor on static method call\r\n\r\n* Fix test failure due to CommaEntry not having correct type size.\r\nMorph comma nodes properly.\r\n\r\n* Type size for Void should be 0\r\n\r\n* Explain why comma entry code gen does nothing",
