          "id": "81d0e7094ed20666dc3e297482d395b1dd21daa8",
          "message": "Finish off Ssa (#356)\n\n* Add Tree Visitor Classes ready to use in renaming variables\r\nAdd SsaRenameState to hold stacks used in renaming\r\nHook up renaming in SsaBuilder to walk the dominator tree\r\n\r\n* Make SsaNumber writeable on Local Var read/write nodes\r\n\r\n* Extend Local Variable descriptors to include:\r\n* If they are tracked or not\r\n* If they are in SSA or not\r\n* If they are address exposed or not\r\n* PerSsaData used in Ssa Construction\r\n\r\n* Set local variables as address exposed if they are referenced in ldloca or ldarga instructions\r\n\r\n* Implement main variable renaming part of SSA\r\nNote Phi nodes not being updated yet.\r\n\r\n* Log/print Ssa summary\r\n\r\n* Add PhiArg node used in PhiNode.Arguments\r\n\r\n* Add Prev link to StackEntry to allow navigating that LIR backwards\r\n\r\n* Finish off Ssa by adding PhiArgs' to PhiNodes\r\nAdd new DumpSsa option to control output of Ssa information\r\n\r\n* Update SsaBuilder Todo comment\r\n\r\n* Setup a dummy root basic block if the first basic block has predecssors, i.e. is a loop.\r\n\r\n* Fix code smells\r\n\r\n* Fix code smells",
