          "id": "86f38e73176b74166d2d0bd5994dc1c175fa0fb9",
          "message": "Add simple preinitialization support (#368)\n\n* Add PreinitializationManager\r\n\r\n* Only call static constructor if the type is not preinitialized\r\n\r\n* Add guts of pre initialization\r\nSupports only very simple cctors using ldc/stsfld/ret\r\n\r\n* Use preinitialized data when generating statics\r\n\r\n* Only add dependency on cctor if it is not preinitialized\r\n\r\n* Add flags to EEType\r\nSet flags based on if type has lazy static constructor or not\r\n\r\n* Add helper to check is type has explicit cctor\r\n\r\n* Fix bug with EETypePtrOf<T> not resolving generic parameter properly.\r\n\r\n* Add some preinitialization tests\r\n\r\n* Fix code smells",
