          "distinct": true,
          "id": "2b35bb93db38790f288fb466e078f9e26281f0c9",
          "message": "Exception handling matches catch handlers based on exception type (#438)\n\n* Emit catch handler type into ehclauses\r\n\r\n* Need to copy extra 2 bytes for Catch handler type when enumerating eh clauses\r\n\r\n* Put proper exception object into ExInfo instead of null object\r\n\r\n* Optimise exception object code when throwing exception\r\n\r\n* Need to use call in null check to ensure there is a return address usable when unwinding stack frames\r\n\r\n* Check exception type against handler type as part of exception dispatch\r\n\r\n* Add extra exception handling tests to validate correct handlers are matched based on exception type.\r\n\r\n* SP validation on method exit is not possible when exception handling is enabled as SP is not guaranteed to be restored 100% by EH unwinding code. The unwinding code doesn't know the number of paramteters pushed on the stack prior to a method call and so can only restore the SP to the state is was in at the point the z80 call opcode was executed.\r\n\r\nThis shouldn't cause any problems as no codegen relys on SP being exact after method call. May need to revisit this in the future though\r\n\r\n* Tidy up todo in exception handling tests",
